private static Pattern getKeyPattern(String keyName) {
    final String keyPatternString = "^" + SPACE_PATTERN.matcher(keyName)
            .replaceAll(Matcher.quoteReplacement("\\\\ ")) + "[\\s:=].*";
    return Pattern.compile(keyPatternString);
}
